import logo from './logo.svg';
import './App.css';

function Title(props) {
  return (
    <header>
      <h1>{props.title}</h1>
    </header>
  )
}

function AboutMe() {
  return (
    <section>
      <h1>About Me</h1>
      <img src='/profile.jpg' alt='Profile Picture' />
      <p>Placeholder text</p>
    </section>
  )
}

function Contact(props) {
  return (
    <footer>
      <h1>Contact</h1>

      <p>{props.year}</p>
    </footer>
  )
}

function App() {
  return (
    <div className='App'>
      <Title title='David Strupinski' />
      <AboutMe />
      <Contact />
    </div>
  );
}

export default App;
